import {useCookies} from "react-cookie";

export default function ResultQuestion(props){
    let [cookies,setCookies]=useCookies()
    let result=getResult(cookies['quizAnswers']);

    return(
       <Card data={resultContent[+result]} />
    )
}

function Card(props){
    return(
        <div>
            <h3>Вам больше подходит должность:{props.data.profession}</h3>
            <img src={props.data.image}/>
        </div>
    )
}

function getResult(cookies) {
    let str = cookies;
    let obj = {};
    for (let i = 0; i < str.length; i++) {
        let key = str[i];
        if (obj[key] === undefined) {
            obj[key] = 1;
        } else {
            obj[key]++;
        }
    }
    let maxNum = -1;
    let maxValue = '';
    for (let index in obj) {
        let value = obj[index];
        if (value > maxNum) {
            maxNum = value;
            maxValue = index;
        }
    }
    return maxValue;
}


